<h2 id="reason">Reason</h2>

<p>One team has many <code class="highlighter-rouge">FinalFileEntityPk</code>s, so <code class="highlighter-rouge">Set</code> is needed.</p>
<h2 id="solution">Solution</h2>

<p>Use <code class="highlighter-rouge">Set&lt;FinalFileEntityPK&gt;</code> instead of <code class="highlighter-rouge">FinalFileEntityPK</code></p>
